const API_URL = process.env.REACT_APP_COUNTERPARTY_API_URL

export const fetchExternalTrades = async () => {
  try {
    const response = await fetch(`${API_URL}/trades`)
    if (!response.ok) throw new Error('Failed to fetch external trades')
    return await response.json()
  } catch (error) {
    throw new Error(`Error fetching external trades: ${error.message}`)
  }
}
